const nextViewBtn = document.querySelector('#homeView button');
const generatePDFBtn = document.querySelector('#diplomaView button');
const result = document.querySelector("#resultadoNombre");
var diploma = document.querySelector("#diplomaView").style;
var name = document.querySelector("#pdfDownload");

// PDF Dise√±o a Base64
var imgData = "data:image/png;base64,";

// Muestra los meses
var meses = new Array ("Enero","Febrero","Marzo","Abril","Mayo","Junio","Julio","Agosto","Septiembre","Octubre","Noviembre","Diciembre");
var f = new Date();
var fecha = f.getDate() + " de " + meses[f.getMonth()] + " de " + f.getFullYear();

const nextView = (personName = document.querySelector("#inputName").value.trim()) => {
	if (!personName) return;
	const home = document.querySelector("#homeView").style;
	result.innerHTML = personName;
	home.display = 'none';
	diploma.display = 'grid';
}

const generatePDF = () => {
	const doc = new jsPDF('l', 'mm', 'letter');
	const { innerHTML } = result;
	doc.setFont("helvetica")

	doc.setTextColor(77,190,212)
	doc.setFontType('bold')
	doc.setFontSize(40)
	doc.text(140, 130, innerHTML, 'center')

	doc.setTextColor(73,80,88)
	doc.setFontType('normal')
	doc.setFontSize(18)
	doc.text(140, 200, fecha, 'center')

	doc.addImage(imgData, 'PNG', 0, 0, 280, 216)
	doc.save(`Diploma de ${ innerHTML } - ${ fecha }.pdf`);
}

nextViewBtn.addEventListener('click', () => nextView());
generatePDFBtn.addEventListener('click', () => generatePDF());